import React from 'react';
import Map from './Map';
import Menu from './Menu';
import GameText from './GameText';

class App extends React.Component {
    render() {
        const appStyle = {
            backgroundColor: "rgb(0, 0, 0)",
            display: "flex",
            height: "100%"
        };

        return (
            <React.Fragment>
                <Menu />
                <Map />
                <GameText />
            </React.Fragment>
        )
    }
}

export default App;
